‚†Ä
Immediately after a sprained ankle, you will see and feel swelling and pain or stiffness around the ankle. It may be difficult or even impossible to walk on. The first thing you should do is find out what kind of injury you have. Is it a sprain or a fracture? It is absolutely imperative to find out what kind of injury you have, because that will help you on your road to a full recovery. Now, if it‚Äôs just an ankle sprain, you can begin a rehab program immediately. But, if it‚Äôs a fracture, you will want to immobilize the ankle until the fracture heals.‚†Ä
‚†Ä
Many people mistakenly think that the first thing they should do is ice their ankle. But, studies have consistently shown that ice does not help to heal your ankle and can actually cause a great deal of harm. The only real benefit of ice is mild, short term pain relief, because it stops the communication between nerves and muscle, which makes the area go numb. But, it does not reduce inflammation and in fact, can actually cause damage.‚†Ä
What you need is a high quality ankle rehab program that removes the water and swelling quickly, while also promoting healthy blood flow to increase the circulation of healthy immune cells into the ankle. These powerful immune cells will eat up the debris and swelling and then regenerate healthy tissue. The sooner you start a good ankle rehab program, the better. You don‚Äôt want scar tissue to develop and weakness and instability can become a long term concern if not dealt with properly. Overall, a good ankle rehab program should not take more than 20-30 minutes a day.‚†Ä
‚†Ä
