-
Low back pain or hip pain. This is a standing hip flexor stretch. It's going to stretch primarily the short hip flexors that only cross the hip joint here. It's primarily used with people that have low back pain or knee pain. So the first thing that you're going to want to do is get into a stride stance, which is one foot in front of the other, about hip distance apart.¬†
-
You want to make sure your feet are pointed straight forward. They're not turning outward or inward at all. And you want to come up to your pelvis, and make sure you're not arching through your low back. So you want to tuck all the way under by tightening your glutes and your lower abdominals. Once you're in that nice tucked position, you want to keep your back leg straight -- this is the leg that you're stretching -- and you're slowly going to lunge forward until you feel a stretch across the front of your hip joint here.
-
¬†You should not feel any low back pain. If you do, back out of the stretch, and try tucking again. Maybe you didn't tuck under enough. So tuck ALL the way under, you might feel a stretch already, even without lunging -- and if you do, just hold here. If you don't, then you can try again to slowly lunge forward. Then hold that position for 30 seconds to 1 minute. And that's your standing hip flexor stretch.
